package SiriProgram;

public class swapNumberAnother {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a, b, temp;
		a = 15;
		b = 17;
		System.out.println("Before Swap "+a+ " "+b);
		temp = a;
		a=b;
		b = temp;
		System.out.println("After Swap "+a+ " "+b);

	}

}
